.right-box
    width 400px
    margin-left 50px
    border:1px solid #ddd;
    border-radius 4px
    height 700px
    overflow-y scroll
    &::-webkit-scrollbar {
        /*滚动条整体样式*/
        width : 4px;  /*高宽分别对应横竖滚动条的尺寸*/
        height: 1px;
    }
    &::-webkit-scrollbar-thumb {
        /*滚动条里面小方块*/
        border-radius: 4px;
        box-shadow   : inset 0 0 5px rgba(0, 0, 0, 0.2);
        background   : #535353;
    }
    &::-webkit-scrollbar-track {
        /*滚动条里面轨道*/
        box-shadow   : inset 0 0 5px #fff;
        border-radius: 4px;
        background   : #fff;
    }
.title-bar
    width 100%
    height 38px
    line-height 38px
    padding-left 24px
    color #333
    border-radius 4px
    border-bottom 1px solid #eee
